import React from "react";

const Library = ({ library }) => {
  if (library.length === 0) {
    return <p>No hay elementos en tu biblioteca todav√≠a.</p>;
  }

  return (
    <div className="library">
      <h2>Tu Biblioteca</h2>
      <ul className="library-list">
        {library.map((item, index) => (
          <li key={index} className="library-item">
            <img src={item.image} alt={item.album} width={64} />
            <div>
              <h4>{item.album}</h4>
              <p>{item.artist}</p>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Library;
